INSERT INTO `especialidad` VALUES (1,'Cardiología','Encargada de las enfermedades del corazón y del aparato circulatorio','2015-10-24 22:59:09','2015-11-05 00:11:33',1),(2,'Dermatología','Encargada del estructura y función de la piel.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(3,'Neurología','Encargada de los trastornos del sistema nervioso.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(4,'Obstetricia','Encargada del embarazo y el parto.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(5,'Ginecología','Encargada de la especialidad médica y quirúrgica que trata las enfermedades del sistema reproductor femenino.','2015-10-24 22:59:09','2016-02-27 23:37:04',1),(6,'Odontología','Encargada del diagnóstico, tratamiento y prevención de las enfermedades del aparato estomatognático.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(7,'Oftalmología','Encargada de las enfermedades y cirugía del ojo','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(8,'Pediatría','Encargada de las enfermedades de los niños.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(9,'Podología','Encargada del diagnostico y el tratamiento de las enfermedades que afectan al pie.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(10,'Traumatología','Encargada de las lesiones del aparato locomotor.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(11,'Urología','Encargada del diagnostico y el tratamiento de las patologías que afectan al aparato urinario de ambos sexos.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(12,'Cirugía','Encargada de las operaciones del tracto hígado, la mama así como las hernias de la pared abdominal y otras partes del cuerpo.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(13,'Hematología','Es la especialidad médica que se dedica al tratamiento de los pacientes con enfermedades hematológicas.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(14,'Neumologia','Es la especialidad médica encargada del estudio de las enfermedades del aparato respiratorio.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(15,'Reumatología','Es la especialidad médica que abarca todas las enfermedades del aparato locomotor.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(16,'Proctología','Es la parte de la medicina encargada del estudio y tratamiento de las enfermedades de la región anal.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(17,'Otorrinolaringología','Es la especialidad medica que se encarga de la prevención, diagnostico y tratamiento, tanto medico como quirúrgico, de las enfermedades de: el oído, las vías aéreo-digestivas superiores','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(18,'Alergologia','Es la especialidad médica que comprende el conocimiento, diagnóstico y tratamiento de la patología producida por mecanismos inmunológicos','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(19,'Geriatría','Es la especialidad médica que se ocupa de los aspectos preventivos, curativos y de la rehabilitación de las enfermedades del adulto en senectud.','2015-10-24 22:59:09','2015-10-24 22:59:09',1),(20,'Enfermedades Infecciosas','Se encarga del estudio de las enfermedades infecciosas que son la manifestación clínica consecuente a una infección provocada por un microorganismo como bacterias, hongos, virus, protozoos, etc.','2015-10-24 22:59:09','2015-10-24 22:59:09',1);
